using System;\nusing System.Collections.Generic;\nusing System.Web;\n\npublic class CacheManager\n{\n    private static readonly HashSet<string> _cacheKeys = new HashSet<string>();\n\n    public static void AddToCache(string key, object value)\n    {\n        HttpContext.Current.Cache.Add(key, value);\n        lock (_cacheKeys)\n        {\n            _cacheKeys.Add(key);\n        }\n    }\n\n    public static void PurgeUnusedObjects()\n    {\n        var keysToRemove = new List<string>();\n        \n        foreach (var key in _cacheKeys)\n        {\n            if (HttpContext.Current.Cache[key] == null || IsObjectNoLongerUsed(HttpContext.Current.Cache[key]))\n            {\n                keysToRemove.Add(key);\n            }\n        }\n\n        foreach (var key in keysToRemove)\n        {\n            HttpContext.Current.Cache.Remove(key);\n            lock (_cacheKeys)\n            {\n                _cacheKeys.Remove(key);\n            }\n        }\n    }\n\n    private static bool IsObjectNoLongerUsed(object obj)\n    {\n        // Implement your logic to determine if the object is no longer used\n        return false;\n    }\n}